// Remove <think>...</think> (and optional ```json fences) from this item's text
let text = $json.text ?? $json.output ?? $json.result ?? "";

text = String(text)
  .replace(/<think>[\s\S]*?<\/think>/gi, "")
  .replace(/^```(?:json)?\s*|\s*```$/g, "")
  .trim();

// Return ONLY the cleaned field
return { json: { cleanText: text } };
